import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import XboxLogin from './components/XboxLiveComponents';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<XboxLogin />} />
        {/* Add other routes as needed */}
      </Routes>
    </Router>
  );
}

export default App;
